import React from 'react';
import {Label, Divider, Grid} from 'semantic-ui-react';
const DEFAULT_STATE =  {
  interests: [],
};


function yourInterests(props) {
    if (props.interests)
        return (
            <Grid>
                <Grid.Row>
                    <p className="yourInterests">Your interests</p>
                </Grid.Row>
            </Grid>
        )
    return null
};

class Interests extends React.Component {
    constructor(props){
        super(props);
        this.state = {...DEFAULT_STATE};
    }
    render(){
        const {interests} = this.props;
        return (
            <div className="ui middle InterestsContainer">
                <yourInterests interests={interests}/>
                <Label.Group size='huge'>
                    {interests.map((data, i) => {
                        return (
                            <Label className="interestLabel"
                                   id={i}
                                   key={i}
                                   data={data}
                                   onClick={() => this.props.deleteInterest({data, i})}><strong>#</strong>{data}</Label>
                        )
                    })}
                    <Divider />
                </Label.Group>
            </div>
        )
    }
}

export default Interests;
